import React from "react";
import picture from "../assets/red moon.png";

const Post = ({ title, summary, cover, content }) => {
  return (
    <div className="mx-[66px] my-8 flex gap-x-8">
      <img src={picture} alt="pic" className="h-[160px]  " />
      <div className=" w-[400px] flex gap-y-1 flex-col">
        <span className="font-bold text-xl">{title}</span>
        <div className="text-stone-600 space-x-5 font-bold">
          <span className="text-sm  text-center">harnish</span>
          <span className="text-sm text-center">7/16/23 11:33pm</span>
        </div>
        <span>{summary}</span>
      </div>
    </div>
  );
};

export default Post;
